const initialState = {
  post: [],
};

const post = (state = initialState, action) => {
  switch (action.type) {
    case 'SET_POST':
      return {
        ...state,
        post: [...post],
      };
    case 'SET_POST1':
      return {
        ...state,
        post: [...post],
      };

    default:
      return state;
  }
};

export default post;
